import './style.css';
import { useState } from 'react';

const Account = () => {
  const [settingsTab, changeTab] = useState(false);

  return (
    <div className="account-container">
      <div className="account-tab-header">Your account page</div>
      <div className="tab-switch">
        <label class="switch">
          <input type="checkbox" id="waiter-checkbox" checked="True" />
          <span class="slider round"></span>
        </label>
      </div>
    </div>
  );
};

export default Account;
